    uint256 public u256 = 456;

    /*
        int256 ranges from -2^255 ~2^255-1
    */
    int256 a = -23;
    int256 b = 23;

    //get the max or the min of the int256

    int256 public maxInt = type(int256).max;
    int256 public minInt = type(int256).min;
}

